// Make sure to import any necessary libraries or typings
// For AJAX requests, we'll use the Fetch API

// Fetch and display API data
function fetchData() {
  const queryUrl = "https://www.alphavantage.co/query?function=TIME_SERIES_WEEKLY_ADJUSTED&symbol=IBM&apikey=demo";

  fetch(queryUrl)
    .then(response => response.json())
    .then(data => displayData(data))
    .catch(error => console.error("Error fetching data:", error));
}

// Display API data on the page
function displayData(data: any) {
  const dataContainer = document.getElementById("data-container");

  // Display the data as JSON string in the container
  dataContainer.textContent = JSON.stringify(data, null, 2);
}

// Fetch and display data when the page loads
window.onload = fetchData;
